/*View structure for view loginuser */

/*!50001 DROP TABLE IF EXISTS `loginuser` */;
/*!50001 DROP VIEW IF EXISTS `loginuser` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `loginuser` AS select `suser`.`username` AS `username`,`suser`.`password` AS `userpwd`,(case when (`suser`.`role` = 'admin') then 'R03' when (`suser`.`role` = 'nor_user') then 'R01' when (`suser`.`role` = 'adv_user') then 'R02' end) AS `userrole` from `suser` */;

